vector<bool> toGetIsPrime(ll N)
{
	vector<bool> res(N+1, true);
	res[0] = res[1] = false;

	for (ll i = 2; i*i <= N; ++i)
	{
		if (res[i])
			for (ll j = i*i; j <= N; j += i) res[j] = false;
	}
	return res;
}

